class Solution(object):
    def findNumberIn2DArray(self, matrix, target):
        """
        :type matrix: List[List[int]]
        :type target: int
        :rtype: bool
        """

        def invert_list(lst):
            # invert the list
            lst.reverse()
            # return the reversed list
            return lst

        def binary_search(a, target):
            # binary search
            # return the index of a in a or -1 if target not found
            left, right = 0, len(a) - 1
            while left < right:
                mid = (left + right) // 2
                if a[mid] < target:
                    left = mid + 1
                else:
                    right = mid
            if a[left] == target:
                return left
            else:
                return -1

        def binary_search_recursive(a, target, left, right):
            # binary search with recursive
            # return the index of a in a or -1 if target not found
            if left > right:
                return -1
            mid = (left + right) // 2
            if a[mid] < target:
                return binary_search_recursive(a, target, mid + 1, right)
            elif a[mid] > target:
                return binary_search_recursive(a, target, left, mid - 1)
            else:
                return mid

        ans = binary_search(invert_list(matrix), target)
        if ans == -1:
            return 'Invalid'
        return ans + 1

