class Solution:
    def numMedianSamples(self, nums: List[int], k: int) -> int:
        n, m = len(nums), len(nums)
        s, r = 0, n - 1
        while True:
            if s == n:
                break
            if r == n:
                return (k - 1) * m
            mid = (s + r) // 2
            if mid > 0:
                mid_value = nums[mid]
                nums_min = min(nums[:mid])
                nums_max = max(nums[mid + 1:])
                if mid_value < nums_min and nums_max < nums_min:
                    answer = k - mid
                    return answer
                if mid_value > nums_min:
                    if mid_value == nums_max:
                        answer = k - mid
                        return answer
                    if mid_value < nums_min:
                        answer = k - mid - 1
                        return answer
            if s == 0:
                s += 1
            elif s == 1:
                r -= 1
            elif s == n - 1:
                r = n - 1
            else:
                s += 1
        return 0

