        # This implementation is based on a bottom-up approach which can be found here: https://www.youtube.com/watch?v=cQsJFo-dY2
        l, r = 0, num
        while l < r:
            mid = l + (r-l)//2
            if num >= mid:
                r = mid
            else:
                l = mid + 1
        return l

    def a(nums, d):
