class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        length, start, end = 0, 0, 0
        i = 0
        for j in range(len(s)):
            while i < j and s[i]!= s[j]:
                i += 1
            if i < j:
                i += 1
                length = max(length, j - i + 1)
            else:
                start = j + 1
                end = i
        return max(length, end - start + 1)

