import sys

class Trie:
    def __init__(self):
        self.root = {}

    def insert(self, word):
        curr = self.root
        for c in word:
            if c not in curr:
                curr[c] = {}
            curr = curr[c]
        curr[None] = 1

    def search(self, word):
        curr = self.root
        for c in word:
            if c not in curr:
                return False
            curr = curr[c]
        return True

    def __len__(self):
        return len(self.root)

class Solution:
    def solveNQueens(self, n: int) -> List[List[str]]:

        #we create a trie of n queens, so that we can represent the size of the tries
        trie = Trie()

        #init first row of the tries, starting from bottom
        tries = [[]]

        for i in range(n):
            #now we check if all the rows are valid
            #first we add the all the valid rows to the trie
            for j in range(n):
                if len(tries[j]):
                    tries[j].append(i)
                    #now we check if any of the last elements of the row is the same as the first element
                    if len(tries[j]):
                        #if the last element is the same as the first element, we only have to check that
                        #we have not already checked rows of the same length
                        if len(tries[j]):
                            #then we recursively call our recursion with the next row of the tries
                            #and the remaining rows of the tries
                            self.__add_tries(tries, j, i, trie)

        #now we sort all the valid rows in the trie, and return it
        return sorted(trie.root.values(), key=lambda x: len(x))

        def __add_tries(tries, i, j, trie):

            if len(tries[j]):
                #we go over the remaining rows, but we also keep the best answer
                #in this, we remove the best answer to the current row, and we add it to the current row's answer
                for c in range(j, n):
