def

def solution(stdin: str) -> str:
    n, a = map(int, stdin.split())
    if n < 0 or n > 1000000 or any(a < 0 or a > 10**9): return "0"
    x = [0] + [a for _ in range(n)]
    y = [0 for _ in range(n)]
    for i in range(n):
        y[i] = x[i+1] - x[i]
    z = [0 for _ in range(n)]
    for i in range(n-1):
        for j in range(i+1,n):
            z[i] += x[j] - x[i]
    return str(min(y[i]+z[i] for i in range(n)))
